        label: 'Albania',
        backgroundColor: 'rgba(255,255,255,1)',
        borderColor: 'rgba(255,255,255,1)',
        borderWidth: 2,
        data: v8,
        spanGaps: false,
        parsing: {
          xAxisKey: 'time',
          yAxisKey: 'Albania'
          
        }
      },

      {
